Gkg","isOwnerViewing":false,"shortDescription":"Join us for our next conference: https://goo.gl/B2bqQ6\nLong before Agile and Lean became buzzwords, a scrappy group of aerospace engineers at Lockheed's Skunk Works were using similar practices to produce some of the most amazing aircraft ever built. The famous U-2 spy plane, the SR-71 Blackbird, and the F-117A Stealth Fighter are among the incredible planes the engineers at Skunk Works produced under impossibly tight deadlines and very limited budgets.\n\nWhat can we learn from the stories of these amazing planes and the engineers who built them? Let’s go back to our roots and let the original experts teach us about building awesome stuff together.\n\nAbout Nickolas Means\n\nNick hails from Austin, TX, the Taco Capital of the World. When he’s not busy eating tacos, he’s the VP of Engineering at Muve Health, working with an incredibly talented team of developers to change how healthcare is delivered and paid for in the US. He’s a huge believer that software development is mostly human interaction and that empathy is the key to building great software.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/pL3Yzjk5R4M/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDnEYnTK97CBg7CfC4zGNmWzfwCiQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/pL3Yzjk5R4M/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBRj4j4f2xxrDLZV5WbA9GTVno19Q","width":196,"height":110},{"url":"https://i.ytimg.com/vi/pL3Yzjk5R4M/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCIAq-Ot1zBYfV0c623UkdQBpllpA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/pL3Yzjk5R4M/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLD4uu_Hik8l3wOZtfJX_SuAk0AxTA","width":336,"height":188},{"url":"https://i.ytimg.com/vi/pL3Yzjk5R4M/maxresdefault.jpg","width":1920,"height":1             endpoint: endpoint
          };
        };

        if (window.loadDataHook) {
          var pageData = window.getPageData();
          window.loadDataHook(pageData.endpoint, pageData.data);
          window.loadDataHook = null;
        }
        setFiller();

    })();
  </script>
